import Form from "react-bootstrap/Form";

export default function SwitchButton({ automoveis, veiculosFiltrados, setVeiculosFiltrados, filtrarVeiculos }) {
  return (
    <>
      {automoveis.map((marca, index) => (
    <Form>
      <Form.Check
        type="switch"
        id="custom-switch"
        veiculosFiltrados={veiculosFiltrados}
        setVeiculosFiltrados={setVeiculosFiltrados}
        filtrarVeiculos={filtrarVeiculos}
      />
    </Form>
    ))}
    </>
  );
}
